import logo from './logo.svg';
import './App.css';
class Aggregate extends Component{
  render(){
    return(
        <div style={{width: '40%', display: 'inline-block'}}>
          <h2 style={{color: '#545454'}}>Number Text</h2>
        </div>
    );
  }
}
class App extends Component {
  render() {
      let name ='Adam'
    return (
      <div className="App">
      <h1>GuessTrack</h1>
      <Aggregate/>
       <Aggregate/>
      </div>
    );
  }
}

export default App;
